import React from "react";
import NextLink from "next/link";
import { Box } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<{}> = () => {
  return (
    <Container>
      <Bar>
        {/* <InnerBar> */}
        <NextLink href="/">
          <Logo style={{ cursor: "pointer", color: "#fff" }}>LOGO</Logo>
        </NextLink>
        <Nav>
          <Categories style={{ color: "#fff" }}>
            <NextLink href="/catagories">CATAGORIES</NextLink>
          </Categories>
          <About style={{ color: "#fff" }}>
            <NextLink href="/about">ABOUT</NextLink>
          </About>
          <SearchBar>
            <input
              placeholder="🔍"
              style={{
                width: "7vw",
                textIndent: "5px",
                height: "30px",
                fontSize: "15px",
              }}
            ></input>
          </SearchBar>
        </Nav>

        {/* </InnerBar> */}
      </Bar>
    </Container>
  );
};

export default NavBar;
